import React from "react";
import Login from "./edocLogin";
// import edocMain from "./edocMain";

import EdocMain from "./edocMain";

// 유저 정보에 의해 폼이 바뀌는 것
// 이후 리덕스와 연결하여 state 중앙통제실을 만들어서 사용한다.
const dummy = {
  isLogined: true
};
const Main = () => {
  return <div>{dummy.isLogined ? <EdocMain /> : <Login />}</div>;
};

export default Main;
